  function funcCancel() {
    const dictCourse = {
      In: "1",
      Out: "2",
    };
    const fd = [year.ch(2), month, date].join("");
    const key = [fd, time, dictCourse[course]].join("");

    log("key", key);
    let target = window[key];    
    log(target);
    if (target) {
      target.click();
      btn_delete.click();
    } else {
      funcEnd();
    }
  }

